import React from 'react';
import { NavLink } from 'react-router-dom';
import home_img from '../src/image/hospital_home.jpg';
import Common from './Common'

export default function Home() {
    return (
        <>

       <Common
        name="Home"
        imgSrc={home_img}
        visit="/service"
        btnnae="Get Started"
         />
        
            
        </>
    )
}
